import React from 'react'

function MainContent({ stories }) {

    return (
        <div className="table">
            {stories.map((story) => (
                <tr key={story.id}>
                    <td>{story.by}</td>
                    <td>{story.title}</td>
                    <td>{story.url}</td>
                    <td>{story.score}</td>
                </tr>
            ))}
        </div>
    )
}

export default MainContent
